package loopPratice;

class PrintNuaturalNumber {
	int num = 10, i = 1;

	void programmNaturalNumber() {
		while (i <= num) {
			System.out.println(i);
			i++;
		}
	}

}

public class NNaturalNumber {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		PrintNuaturalNumber obj = new PrintNuaturalNumber();
		obj.programmNaturalNumber();

	}

}
